import React, { useState } from 'react';
import { Form ,Col, Container, FormGroup} from 'reactstrap';
import '../styles/admin.css';

function Admin() {

 

  const [showAddTourDetails, setShowAddTourDetails] = useState(true);
  

  function handleAddTourButtonClick() {
    setShowAddTourDetails(true);
  }

  function handleDeleteTourButtonClick() {
    setShowAddTourDetails(false);
  }
  
  

  return (
    <Container>
        <Col>
    <div>
      <h1>Tour Details Page</h1>
      {showAddTourDetails ? <AddTourDetailsForm /> : <DeleteTourDetailsButton />}
      <div>
        <button onClick={AddTourDetailsForm}>Add Tour Details</button>
        <button onClick={handleDeleteTourButtonClick}>Delete Tour Details</button>
      </div>
    </div>
    </Col>
    </Container>
  );
}

function AddTourDetailsForm() {
  // Render the form to add tour details
  const [title, setTitle] = useState("");
  const [city, setCity] = useState("");
  const [address, setAddress] = useState("");
  const [distance, setDistance] = useState();
  const [price, setPrice] = useState();
  const [maxGroupSize, setMaxGroupSize] = useState();
  const [desc, setDesc] = useState("");
  const [photo, setPhoto] = useState(null);
  const [featured, setFeatured] = useState(false);

  const handleSubmit = (e) => {
    e.preventDefault();
    const newTour = {
      title,
      city,
      address,
      distance,
      price,
      maxGroupSize,
      desc,
      reviews: [],
      photo : photo,
      featured,
    };
    console.log(newTour);

    fetch('http://localhost:4000/api/v1/tours', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      credentials: 'include',
      body: JSON.stringify(newTour),
    })
      .then(response => response.json())
      .then(data => {
        console.log('Success:', data);
        // TODO: Add some feedback to the user that the tour was added successfully
        alert('Successfully added');
       
      })
      .catch((error) => {
        console.error('Error:', error);
        // TODO: Add some feedback to the user that there was an error adding the tour
        alert(error.message);
      });
  };

  return (
    <div className="form-input">
    <Form  className="form-container" onSubmit={handleSubmit}>
      
      <FormGroup>
        <input type="text" placeholder='Title' value={title} onChange={(e) => setTitle(e.target.value)} />
      
        </FormGroup>

        <FormGroup>
        <input type="text" placeholder='City' value={city} onChange={(e) => setCity(e.target.value)} />
        </FormGroup>

        <FormGroup>
        <input type="text" placeholder='Address' value={address} onChange={(e) => setAddress(e.target.value)} />
        </FormGroup>

        <FormGroup >
        <input type="number" placeholder="Distance" id='distance' required  value={distance} onChange={(e) => setDistance(e.target.value)} />
        </FormGroup>

        <FormGroup>
        <input type="number" placeholder="Price" id='price' required  value={price} onChange={(e) => setPrice(e.target.value)} />
        </FormGroup>
      
        <FormGroup>
        <input type="number" placeholder="MaxGroupSize" id='size' required  value={maxGroupSize} onChange={(e) => setMaxGroupSize(e.target.value)} />
        </FormGroup>
      
      <FormGroup>
        <input type='text' placeholder='Desc' value={desc} onChange={(e) => setDesc(e.target.value)} />
      </FormGroup>
      
      <FormGroup>
        <input type="file" value={photo} onChange={(e) => setPhoto(e.target.value)} />
        </FormGroup>
        
      
      
      <FormGroup>
        <input type="checkbox" checked={featured} onChange={(e) => setFeatured(e.target.checked)} />
        </FormGroup>
      <button className="form-submit-btn" type="submit" onSubmit={handleSubmit}>Add Tour</button>
      
    </Form>
    </div>
  );
}





function DeleteTourDetailsButton() {
  // Render the button to delete tour details
  return (
    <div>
      <h2>Delete Tour Details</h2>
      <button>Delete Tour</button>
    </div>
  );
}



export default Admin;
